import React, {useState} from 'react'

export default function CreatePage() {
    const [formData, setFormData ]= useState({})

    function handleOnChange(e){
        setFormData( {...formData, [e.target.name]: e.target.value})
        console.log(formData)
    }

    function renderInput(name, label, type){
        return (
            <div>
                <label>{label}</label>
                <input 
                type={type || "text"}name={name} onChange={handleOnChange}/>
                <br/>
            </div>
        )
    }
    return (
        <div>
            <form>
                {renderInput("name", "Organisation Name")}
                {renderInput("name", "Organisation Number", "email")}
                {renderInput("name", "VAT number")}
                {renderInput("name", "Reference")}
                {renderInput("name", "Payment Term")}
                {renderInput("name", "website", "url")}
                {renderInput("name", "Email")}
                {renderInput("name", "Phone Number", "tel")}
            </form>
        </div>
    )
}
